import React, { Component } from 'react';
import { Grid, IconButton, CardMedia } from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight
} from "@fortawesome/free-solid-svg-icons";

class LandingPage extends Component {
    render() {
        return (
          <div>
            <CardMedia
              image={this.state.urlImage}
              width="100%"
              style={{
                height: "700px"
              }}
            >
              <Grid
                container
                direction="row"
                style={{
                  alignContent: "center",
                  alignItems: "center",
                  justifyContent: "space-between",
                  flexGrow: 1
                }}
              >
                <IconButton onClick={this.handleBackClick}>
                  <FontAwesomeIcon
                    style={{ color: "grey" }}
                    icon={faChevronLeft}
                  />
                </IconButton>
                <IconButton onClick={this.handleNextClick}>
                  <FontAwesomeIcon
                    style={{ color: "grey" }}
                    icon={faChevronRight}
                  />
                </IconButton>
              </Grid>
            </CardMedia>
          </div>
        );
    }
}

export default LandingPage;
